    false,nt"url": null,nt"notes": "This proposal is for the Missouri Chutes
    National Wildlife Refuge that would be in Nebraska and Iowa on the Missouri River.
     This preliminary project proposal focuses on the Sioux City, IA to Plattsmouth,
    NE segment of the river. The Papio-Missouri River Natural Resource District (District)
    in Nebraska isimplementing the Missouri River Corridor Project. The Service will
    be a cooperator in that project. The project's goals are to provide "long-term
    enhancement of fish and wildlife habitat, historical and cultural resources, and
    the development of public recreation sites within the Missouri River flood plain."",nt"license_title":
